import React from "react";
import { Link } from "react-router-dom";
import homeImage from "../assets/home-image.png"; // Update with the correct image path

const Home = () => {
  return (
    <div className="container mt-5">
      <div className="row align-items-center">
        {/* Left Side Content */}
        <div className="col-md-6">
          <h1>Welcome to NutriFit-Hub</h1>
          <p className="lead">
            Your one-stop platform for personalized health tips, diet plans, and fitness routines. 
            Stay fit, eat healthy, and achieve your wellness goals with NutriFit-Hub.
          </p>
          <Link to="/dashboard" className="btn btn-primary me-2">Get Started</Link>
          <Link to="/about" className="btn btn-outline-secondary">Learn More</Link>
        </div>

        {/* Right Side Image */}
        
      </div>
    </div>
  );
};

export default Home;
